import React from 'react';
import {
  Box,
  Grid,
  Typography,
  Link,
  Chip,
  Paper,
  Tooltip,
  IconButton,
} from '@mui/material';
import OpenInNewIcon from '@mui/icons-material/OpenInNew';
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import { getMeteoraLink } from '../../utils/helpers';

const DataPoint = ({ label, value, tooltip, copyable }) => {
  const handleCopy = () => {
    navigator.clipboard.writeText(value?.toString() || '');
  };

  return (
    <Box sx={{ mb: 2 }}>
      <Typography 
        variant="caption" 
        color="text.secondary"
        sx={{ 
          display: 'block',
          mb: 0.5,
          fontWeight: 500 
        }}
      >
        {label}
      </Typography>
      <Box sx={{ 
        display: 'flex', 
        alignItems: 'center',
        gap: 1 
      }}>
        <Typography 
          variant="body2"
          sx={{ 
            fontFamily: copyable ? 'monospace' : 'inherit',
            bgcolor: copyable ? 'background.default' : 'transparent',
            p: copyable ? 0.5 : 0,
            borderRadius: 1,
            fontSize: copyable ? '0.8rem' : 'inherit'
          }}
        >
          {value || 'N/A'}
        </Typography>
        {copyable && value && (
          <Tooltip title="Copy to clipboard">
            <IconButton 
              size="small" 
              onClick={handleCopy}
              sx={{ 
                color: 'text.secondary',
                '&:hover': { color: 'primary.main' }
              }}
            >
              <ContentCopyIcon fontSize="small" />
            </IconButton>
          </Tooltip>
        )}
      </Box>
    </Box>
  );
};

const ExpandedRow = ({ pair }) => {
  if (!pair) return null;

  return (
    <Box sx={{ px: 3 }}>
      <Grid container spacing={3}>
        {/* Pool Info */}
        <Grid item xs={12} md={4}>
          <Paper 
            variant="outlined" 
            sx={{ 
              p: 2,
              height: '100%',
              bgcolor: 'background.default'
            }}
          >
            <Typography 
              variant="subtitle2" 
              sx={{ 
                mb: 2,
                fontWeight: 600,
                color: 'primary.main' 
              }}
            >
              Pool Info
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <DataPoint 
                  label="Pool Address" 
                  value={pair.address}
                  copyable
                />
              </Grid>
              <Grid item xs={12}>
                <Link
                  href={getMeteoraLink(pair)}
                  target="_blank"
                  rel="noopener noreferrer"
                  sx={{
                    display: 'flex',
                    alignItems: 'center',
                    gap: 0.5,
                    color: 'primary.main',
                    textDecoration: 'none',
                    '&:hover': {
                      textDecoration: 'underline'
                    }
                  }}
                >
                  View on Meteora
                  <OpenInNewIcon sx={{ fontSize: '1rem' }} />
                </Link>
              </Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Statistics */}
        <Grid item xs={12} md={4}>
          <Paper 
            variant="outlined" 
            sx={{ 
              p: 2,
              height: '100%',
              bgcolor: 'background.default'
            }}
          >
            <Typography 
              variant="subtitle2" 
              sx={{ 
                mb: 2,
                fontWeight: 600,
                color: 'primary.main' 
              }}
            >
              Statistics
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}>
                <DataPoint 
                  label="24h Volume" 
                  value={`$${(pair.volume24h || 0).toLocaleString()}`}
                />
              </Grid>
              <Grid item xs={6}>
                <DataPoint 
                  label="24h Fees" 
                  value={`$${(pair.fees24h || 0).toLocaleString()}`}
                />
              </Grid>
              <Grid item xs={6}>
                <DataPoint 
                  label="Total Liquidity" 
                  value={`$${(pair.totalLiquidity || 0).toLocaleString()}`}
                />
              </Grid>
              <Grid item xs={6}>
                <DataPoint 
                  label="APR" 
                  value={`${(pair.apr || 0).toFixed(2)}%`}
                />
              </Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Pool Parameters */}
        <Grid item xs={12} md={4}>
          <Paper 
            variant="outlined" 
            sx={{ 
              p: 2,
              height: '100%',
              bgcolor: 'background.default'
            }}
          >
            <Typography 
              variant="subtitle2" 
              sx={{ 
                mb: 2,
                fontWeight: 600,
                color: 'primary.main' 
              }}
            >
              Pool Parameters
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}>
                <DataPoint 
                  label="Bin Step" 
                  value={pair.binStep || 0}
                />
              </Grid>
              <Grid item xs={6}>
                <DataPoint 
                  label="Base Fee" 
                  value={`${pair.baseFee || 0}%`}
                />
              </Grid>
              <Grid item xs={12}>
                <Box sx={{ mt: 1 }}>
                  <Chip 
                    label={pair.is_blacklisted ? 'Blacklisted' : 'Active'} 
                    color={pair.is_blacklisted ? 'error' : 'success'}
                    size="small"
                    sx={{ 
                      fontWeight: 500,
                      fontSize: '0.75rem'
                    }}
                  />
                </Box>
              </Grid>
            </Grid>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ExpandedRow;
